    ...typographyStyles.body1,
    overflowY: 'auto',
    minHeight: '32px',
    boxSizing: 'border-box',
    gridRowStart: 2,
    gridRowEnd: 2,
    gridColumnStart: 1,
    gridColumnEnd: 4
});
/**
 * Apply styling to the DialogContent slots based on the state
 */ export const useDialogContentStyles_unstable = (state)=>{
    const styles = useStyles();
